import React from 'react';
import { 
    Box, 
    Container, 
    Grid, 
    Card, 
    CardContent,
    Typography,
    IconButton,
    Tooltip,
    Paper,
    LinearProgress,
    Chip,
    Avatar
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
import SchoolIcon from '@mui/icons-material/School';
import AssignmentIcon from '@mui/icons-material/Assignment';
import SmartToyIcon from '@mui/icons-material/SmartToy';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import AccessTimeIcon from '@mui/icons-material/AccessTime';

function Dashboard() {
    return (
        <Box
            sx={{
                minHeight: 'calc(100vh - 64px)',
                background: 'linear-gradient(135deg, #0A0A0F 0%, #1a1a1f 100%)',
                py: 6,
                position: 'relative',
                '&::before': {
                    content: '""',
                    position: 'absolute',
                    top: 0,
                    right: 0,
                    bottom: 0,
                    left: 0,
                    background: 'radial-gradient(circle at 50% 0%, rgba(220, 20, 60, 0.1) 0%, transparent 50%)',
                    pointerEvents: 'none'
                }
            }}
        >
            <Container maxWidth="xl">
                {/* Quick Stats Row */}
                <Box sx={{ mb: 4 }}>
                    <Grid container spacing={3}>
                        {[
                            { title: 'Study Hours', value: '24h', icon: <AccessTimeIcon />, trend: '+12%' },
                            { title: 'Tasks Completed', value: '15', icon: <AssignmentIcon />, trend: '+8%' },
                            { title: 'Current GPA', value: '3.8', icon: <TrendingUpIcon />, trend: '+0.2' },
                        ].map((stat, index) => (
                            <Grid item xs={12} md={4} key={index}>
                                <Card
                                    sx={{
                                        background: 'rgba(17, 17, 17, 0.6)',
                                        backdropFilter: 'blur(20px)',
                                        borderRadius: 2,
                                        border: '1px solid rgba(255, 255, 255, 0.1)',
                                    }}
                                >
                                    <CardContent sx={{ p: 2 }}>
                                        <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
                                            <Box>
                                                <Typography color="text.secondary" variant="body2">
                                                    {stat.title}
                                                </Typography>
                                                <Typography variant="h4" sx={{ color: 'white', my: 1 }}>
                                                    {stat.value}
                                                </Typography>
                                            </Box>
                                            <Box>
                                                <Avatar sx={{ bgcolor: 'rgba(220, 20, 60, 0.2)', color: '#DC143C' }}>
                                                    {stat.icon}
                                                </Avatar>
                                                <Chip 
                                                    label={stat.trend}
                                                    size="small"
                                                    sx={{ 
                                                        mt: 1,
                                                        bgcolor: 'rgba(220, 20, 60, 0.1)',
                                                        color: '#DC143C',
                                                        borderRadius: 1
                                                    }}
                                                />
                                            </Box>
                                        </Box>
                                    </CardContent>
                                </Card>
                            </Grid>
                        ))}
                    </Grid>
                </Box>

                <Grid container spacing={4}>
                    {/* Class Schedule Section */}
                    <Grid item xs={12} md={6}>
                        <Card
                            sx={{
                                height: '100%',
                                background: 'rgba(17, 17, 17, 0.6)',
                                backdropFilter: 'blur(20px)',
                                borderRadius: 3,
                                border: '1px solid rgba(255, 255, 255, 0.1)',
                                transition: 'transform 0.2s ease-in-out, box-shadow 0.2s ease-in-out',
                                '&:hover': {
                                    transform: 'translateY(-4px)',
                                    boxShadow: '0 8px 24px rgba(220, 20, 60, 0.2)',
                                }
                            }}
                        >
                            <CardContent sx={{ height: '100%', p: 3 }}>
                                <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
                                    <Typography variant="h6" sx={{ 
                                        display: 'flex', 
                                        alignItems: 'center', 
                                        gap: 1.5,
                                        color: 'rgba(255, 255, 255, 0.9)',
                                        fontWeight: 500
                                    }}>
                                        <SchoolIcon sx={{ color: '#DC143C' }} />
                                        Class Schedule
                                    </Typography>
                                    <Tooltip title="Add Class">
                                        <IconButton 
                                            sx={{ 
                                                color: '#DC143C',
                                                '&:hover': {
                                                    background: 'rgba(220, 20, 60, 0.1)',
                                                }
                                            }}
                                        >
                                            <AddIcon />
                                        </IconButton>
                                    </Tooltip>
                                </Box>
                                <Box sx={{ mb: 2 }}>
                                    <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
                                        Today's Progress
                                    </Typography>
                                    <LinearProgress 
                                        variant="determinate" 
                                        value={70} 
                                        sx={{
                                            height: 8,
                                            borderRadius: 4,
                                            bgcolor: 'rgba(255, 255, 255, 0.1)',
                                            '& .MuiLinearProgress-bar': {
                                                bgcolor: '#DC143C',
                                            }
                                        }}
                                    />
                                </Box>
                                <Paper
                                    sx={{
                                        p: 4,
                                        background: 'rgba(255, 255, 255, 0.03)',
                                        borderRadius: 2,
                                        textAlign: 'center',
                                        border: '1px dashed rgba(220, 20, 60, 0.3)',
                                        cursor: 'pointer',
                                        transition: 'all 0.2s ease-in-out',
                                        '&:hover': {
                                            background: 'rgba(255, 255, 255, 0.05)',
                                            border: '1px dashed rgba(220, 20, 60, 0.5)',
                                        }
                                    }}
                                >
                                    <Typography color="text.secondary" sx={{ fontSize: '0.95rem' }}>
                                        Add your class schedule to get started
                                    </Typography>
                                </Paper>
                            </CardContent>
                        </Card>
                    </Grid>

                    {/* Keep the other sections (Exam Dates, Tasks, AI Study Assistant) the same structure but add LinearProgress and other relevant stats to each */}
                    {/* ... Rest of the code remains the same ... */}

                </Grid>
            </Container>
        </Box>
    );
}

export default Dashboard;
